import React from "react";
import Todo from './components/Todo'
import "./App.css";

function App() {
  const todosHtml = todos.map((el) => (
    <p>
      {el.id} {el.text}
    </p>
  ));

  return <div className="todo-app">
    <Todo>{todosHtml}</Todo>
  </div>;
}

export default App;
